const InteractiveMirrorMap = () => {
  const canvasRef = useRef(null);
  const containerRef = useRef(null);
  
  // 视图状态
  const [zoom, setZoom] = useState(1);
  const [offset, setOffset] = useState({ x: 0, y: 0 });
  const [isDragging, setIsDragging] = useState(false);
  const [dragStart, setDragStart] = useState({ x: 0, y: 0 });
  
  // 交互状态
  const [selectedMirror, setSelectedMirror] = useState(null);
  const [hoveredMirror, setHoveredMirror] = useState(null);
  const [selectedZones, setSelectedZones] = useState(['A', 'B', 'C', 'D']);
  const [colorMode, setColorMode] = useState('cleanliness'); // 'cleanliness' | 'zone'
  const [searchQuery, setSearchQuery] = useState('');
  const [searchResult, setSearchResult] = useState(null);
  const [showMinimap, setShowMinimap] = useState(true);
  
  // 画布尺寸
  const [canvasSize, setCanvasSize] = useState({ width: 800, height: 600 });
  
  // 过滤后的镜子数据
  const filteredMirrors = useMemo(() => {
    return MIRROR_DATA.filter(m => selectedZones.includes(m.z));
  }, [selectedZones]);
  
  // 统计数据
  const stats = useMemo(() => {
    const zoneStats = {};
    selectedZones.forEach(z => {
      const zoneMirrors = MIRROR_DATA.filter(m => m.z === z);
      zoneStats[z] = {
        count: zoneMirrors.length,
        avgClean: (zoneMirrors.reduce((sum, m) => sum + m.c, 0) / zoneMirrors.length).toFixed(1)
      };
    });
    return {
      total: filteredMirrors.length,
      zones: zoneStats,
      excellent: filteredMirrors.filter(m => m.c >= 95).length,
      good: filteredMirrors.filter(m => m.c >= 85 && m.c < 95).length,
      fair: filteredMirrors.filter(m => m.c >= 75 && m.c < 85).length,
      poor: filteredMirrors.filter(m => m.c < 75).length,
    };
  }, [filteredMirrors, selectedZones]);
  
  // 坐标转换：数据坐标 -> 画布坐标
  const dataToCanvas = useCallback((x, y) => {
    const scale = Math.min(
      canvasSize.width / (BOUNDS.xMax - BOUNDS.xMin),
      canvasSize.height / (BOUNDS.yMax - BOUNDS.yMin)
    ) * 0.9;
    
    const cx = canvasSize.width / 2 + (x * scale * zoom) + offset.x;
    const cy = canvasSize.height / 2 - (y * scale * zoom) + offset.y;
    
    return { x: cx, y: cy };
  }, [canvasSize, zoom, offset]);
  
  // 画布坐标 -> 数据坐标
  const canvasToData = useCallback((cx, cy) => {
    const scale = Math.min(
      canvasSize.width / (BOUNDS.xMax - BOUNDS.xMin),
      canvasSize.height / (BOUNDS.yMax - BOUNDS.yMin)
    ) * 0.9;
    
    const x = (cx - canvasSize.width / 2 - offset.x) / (scale * zoom);
    const y = -(cy - canvasSize.height / 2 - offset.y) / (scale * zoom);
    
    return { x, y };
  }, [canvasSize, zoom, offset]);
  
  // 查找最近的镜子
  const findNearestMirror = useCallback((cx, cy) => {
    const dataPos = canvasToData(cx, cy);
    const threshold = 15 / zoom; // 点击阈值（米）
    
    let nearest = null;
    let minDist = Infinity;
    
    for (const mirror of filteredMirrors) {
      const dist = Math.sqrt(
        Math.pow(mirror.x - dataPos.x, 2) + 
        Math.pow(mirror.y - dataPos.y, 2)
      );
      if (dist < minDist && dist < threshold) {
        minDist = dist;
        nearest = mirror;
      }
    }
    
    return nearest;
  }, [filteredMirrors, canvasToData, zoom]);
  
  // 绘制画布
  const draw = useCallback(() => {
    const canvas = canvasRef.current;
    if (!canvas) return;
    
    const ctx = canvas.getContext('2d');
    const dpr = window.devicePixelRatio || 1;
    
    // 清空画布
    ctx.setTransform(1, 0, 0, 1, 0, 0);
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    ctx.scale(dpr, dpr);
    
    // 背景
    ctx.fillStyle = '#0f172a';
    ctx.fillRect(0, 0, canvasSize.width, canvasSize.height);
    
    // 绘制网格
    ctx.strokeStyle = '#1e293b';
    ctx.lineWidth = 1;
    const gridSize = 100 * zoom; // 100米网格
    const gridOffset = {
      x: (offset.x % gridSize + gridSize) % gridSize,
      y: (offset.y % gridSize + gridSize) % gridSize
    };
    
    for (let x = gridOffset.x; x < canvasSize.width; x += gridSize) {
      ctx.beginPath();
      ctx.moveTo(x, 0);
      ctx.lineTo(x, canvasSize.height);
      ctx.stroke();
    }
    for (let y = gridOffset.y; y < canvasSize.height; y += gridSize) {
      ctx.beginPath();
      ctx.moveTo(0, y);
      ctx.lineTo(canvasSize.width, y);
      ctx.stroke();
    }
    
    // 绘制中心塔
    const towerPos = dataToCanvas(0, 0);
    ctx.beginPath();
    ctx.arc(towerPos.x, towerPos.y, 12 * Math.min(zoom, 2), 0, Math.PI * 2);
    ctx.fillStyle = '#f59e0b';
    ctx.fill();
    ctx.strokeStyle = '#fbbf24';
    ctx.lineWidth = 2;
    ctx.stroke();
    
    // 绘制塔标签
    if (zoom >= 0.5) {
      ctx.fillStyle = '#ffffff';
      ctx.font = `bold ${Math.max(10, 12 * Math.min(zoom, 1.5))}px system-ui`;
      ctx.textAlign = 'center';
      ctx.textBaseline = 'middle';
      ctx.fillText('塔', towerPos.x, towerPos.y);
    }
    
    // 镜子大小根据缩放调整
    const mirrorSize = Math.max(2, Math.min(8, 4 * zoom));
    
    // 绘制镜子
    filteredMirrors.forEach(mirror => {
      const pos = dataToCanvas(mirror.x, mirror.y);
      
      // 跳过视野外的镜子
      if (pos.x < -20 || pos.x > canvasSize.width + 20 ||
          pos.y < -20 || pos.y > canvasSize.height + 20) {
        return;
      }
      
      const isSelected = selectedMirror?.id === mirror.id;
      const isHovered = hoveredMirror?.id === mirror.id;
      const isSearchResult = searchResult?.id === mirror.id;
      
      // 镜子颜色
      const color = colorMode === 'cleanliness' 
        ? getCleanlinessColor(mirror.c)
        : ZONE_COLORS[mirror.z].bg;
      
      ctx.beginPath();
      ctx.rect(
        pos.x - mirrorSize / 2,
        pos.y - mirrorSize / 2,
        mirrorSize,
        mirrorSize
      );
      ctx.fillStyle = color;
      ctx.fill();
      
      // 选中/悬停/搜索结果高亮
      if (isSelected || isHovered || isSearchResult) {
        ctx.strokeStyle = isSearchResult ? '#f59e0b' : '#ffffff';
        ctx.lineWidth = 2;
        ctx.stroke();
        
        // 光晕效果
        ctx.beginPath();
        ctx.arc(pos.x, pos.y, mirrorSize + 4, 0, Math.PI * 2);
        ctx.strokeStyle = isSearchResult ? 'rgba(245, 158, 11, 0.5)' : 'rgba(255, 255, 255, 0.3)';
        ctx.lineWidth = 2;
        ctx.stroke();
      }
    });
    
    // 绘制比例尺
    const scaleBarWidth = 100;
    const scaleMeters = Math.round(scaleBarWidth / zoom / 0.4);
    ctx.fillStyle = '#64748b';
    ctx.fillRect(20, canvasSize.height - 30, scaleBarWidth, 4);
    ctx.font = '12px system-ui';
    ctx.textAlign = 'left';
    ctx.fillText(`${scaleMeters}m`, 20, canvasSize.height - 38);
    
    // 绘制缩放级别
    ctx.textAlign = 'right';
    ctx.fillText(`${(zoom * 100).toFixed(0)}%`, canvasSize.width - 20, canvasSize.height - 38);
    
  }, [canvasSize, zoom, offset, filteredMirrors, selectedMirror, hoveredMirror, searchResult, colorMode, dataToCanvas]);
  
  // 绘制小地图
  const drawMinimap = useCallback(() => {
    const minimap = document.getElementById('minimap-canvas');
    if (!minimap || !showMinimap) return;
    
    const ctx = minimap.getContext('2d');
    const w = 150, h = 120;
    
    ctx.clearRect(0, 0, w, h);
    ctx.fillStyle = '#1e293b';
    ctx.fillRect(0, 0, w, h);
    
    // 绘制所有镜子（简化）
    const scale = Math.min(w / (BOUNDS.xMax - BOUNDS.xMin), h / (BOUNDS.yMax - BOUNDS.yMin)) * 0.9;
    
    MIRROR_DATA.forEach((m, i) => {
      if (i % 10 !== 0) return; // 每10个画1个
      if (!selectedZones.includes(m.z)) return;
      
      const x = w / 2 + m.x * scale;
      const y = h / 2 - m.y * scale;
      
      ctx.fillStyle = ZONE_COLORS[m.z].bg;
      ctx.fillRect(x - 1, y - 1, 2, 2);
    });
    
    // 绘制视野框
    const viewScale = 1 / zoom;
    const viewW = (canvasSize.width / (canvasSize.width / (BOUNDS.xMax - BOUNDS.xMin) * 0.9)) * scale * viewScale;
    const viewH = (canvasSize.height / (canvasSize.height / (BOUNDS.yMax - BOUNDS.yMin) * 0.9)) * scale * viewScale;
    const viewX = w / 2 - offset.x / (canvasSize.width / (BOUNDS.xMax - BOUNDS.xMin) * 0.9 * zoom) * scale - viewW / 2;
    const viewY = h / 2 + offset.y / (canvasSize.height / (BOUNDS.yMax - BOUNDS.yMin) * 0.9 * zoom) * scale - viewH / 2;
    
    ctx.strokeStyle = '#f59e0b';
    ctx.lineWidth = 2;
    ctx.strokeRect(viewX, viewY, viewW, viewH);
    
  }, [showMinimap, selectedZones, zoom, offset, canvasSize]);
  
  // 初始化画布尺寸
  useEffect(() => {
    const updateSize = () => {
      if (containerRef.current) {
        const rect = containerRef.current.getBoundingClientRect();
        setCanvasSize({ width: rect.width, height: rect.height });
      }
    };
    
    updateSize();
    window.addEventListener('resize', updateSize);
    return () => window.removeEventListener('resize', updateSize);
  }, []);
  
  // 设置画布DPI
  useEffect(() => {
    const canvas = canvasRef.current;
    if (!canvas) return;
    
    const dpr = window.devicePixelRatio || 1;
    canvas.width = canvasSize.width * dpr;
    canvas.height = canvasSize.height * dpr;
    canvas.style.width = `${canvasSize.width}px`;
    canvas.style.height = `${canvasSize.height}px`;
    
    draw();
    drawMinimap();
  }, [canvasSize, draw, drawMinimap]);
  
  // 重绘
  useEffect(() => {
    draw();
    drawMinimap();
  }, [draw, drawMinimap]);
  
  // 鼠标滚轮缩放
  const handleWheel = useCallback((e) => {
    e.preventDefault();
    const delta = e.deltaY > 0 ? 0.9 : 1.1;
    const newZoom = Math.max(0.2, Math.min(10, zoom * delta));
    
    // 以鼠标位置为中心缩放
    const rect = canvasRef.current.getBoundingClientRect();
    const mouseX = e.clientX - rect.left;
    const mouseY = e.clientY - rect.top;
    
    const centerX = canvasSize.width / 2;
    const centerY = canvasSize.height / 2;
    
    const dx = mouseX - centerX;
    const dy = mouseY - centerY;
    
    setOffset(prev => ({
      x: prev.x - dx * (newZoom / zoom - 1),
      y: prev.y - dy * (newZoom / zoom - 1)
    }));
    
    setZoom(newZoom);
  }, [zoom, canvasSize]);
  
  // 鼠标按下
  const handleMouseDown = useCallback((e) => {
    if (e.button === 0) {
      setIsDragging(true);
      setDragStart({ x: e.clientX - offset.x, y: e.clientY - offset.y });
    }
  }, [offset]);
  
  // 鼠标移动
  const handleMouseMove = useCallback((e) => {
    const rect = canvasRef.current.getBoundingClientRect();
    const mouseX = e.clientX - rect.left;
    const mouseY = e.clientY - rect.top;
    
    if (isDragging) {
      setOffset({
        x: e.clientX - dragStart.x,
        y: e.clientY - dragStart.y
      });
    } else {
      // 悬停检测
      const mirror = findNearestMirror(mouseX, mouseY);
      setHoveredMirror(mirror);
      canvasRef.current.style.cursor = mirror ? 'pointer' : 'grab';
    }
  }, [isDragging, dragStart, findNearestMirror]);
  
  // 鼠标松开
  const handleMouseUp = useCallback(() => {
    setIsDragging(false);
  }, []);
  
  // 鼠标点击
  const handleClick = useCallback((e) => {
    if (isDragging) return;
    
    const rect = canvasRef.current.getBoundingClientRect();
    const mouseX = e.clientX - rect.left;
    const mouseY = e.clientY - rect.top;
    
    const mirror = findNearestMirror(mouseX, mouseY);
    setSelectedMirror(mirror);
  }, [isDragging, findNearestMirror]);
  
  // 搜索镜子
  const handleSearch = useCallback(() => {
    if (!searchQuery.trim()) {
      setSearchResult(null);
      return;
    }
    
    const mirror = MIRROR_DATA.find(m => 
      m.id.toLowerCase().includes(searchQuery.toLowerCase())
    );
    
    if (mirror) {
      setSearchResult(mirror);
      setSelectedMirror(mirror);
      
      // 定位到镜子
      const scale = Math.min(
        canvasSize.width / (BOUNDS.xMax - BOUNDS.xMin),
        canvasSize.height / (BOUNDS.yMax - BOUNDS.yMin)
      ) * 0.9;
      
      setOffset({
        x: -mirror.x * scale * zoom,
        y: mirror.y * scale * zoom
      });
      
      // 确保分区可见
      if (!selectedZones.includes(mirror.z)) {
        setSelectedZones(prev => [...prev, mirror.z]);
      }
    } else {
      setSearchResult(null);
    }
  }, [searchQuery, zoom, canvasSize, selectedZones]);
  
  // 切换分区
  const toggleZone = (zone) => {
    setSelectedZones(prev => 
      prev.includes(zone)
        ? prev.filter(z => z !== zone)
        : [...prev, zone]
    );
  };
  
  // 重置视图
  const resetView = () => {
    setZoom(1);
    setOffset({ x: 0, y: 0 });
    setSelectedZones(['A', 'B', 'C', 'D']);
  };
  
  // 定位到分区
  const focusZone = (zone) => {
    const zoneMirrors = MIRROR_DATA.filter(m => m.z === zone);
    if (zoneMirrors.length === 0) return;
    
    const avgX = zoneMirrors.reduce((sum, m) => sum + m.x, 0) / zoneMirrors.length;
    const avgY = zoneMirrors.reduce((sum, m) => sum + m.y, 0) / zoneMirrors.length;
    
    const scale = Math.min(
      canvasSize.width / (BOUNDS.xMax - BOUNDS.xMin),
      canvasSize.height / (BOUNDS.yMax - BOUNDS.yMin)
    ) * 0.9;
    
    setOffset({
      x: -avgX * scale * zoom,
      y: avgY * scale * zoom
    });
    
    setSelectedZones([zone]);
  };
  
  return (
    <div className="flex flex-col h-full bg-slate-950">
      {/* 工具栏 */}
      <div className="flex items-center justify-between p-4 bg-slate-900/80 border-b border-slate-800">
        <div className="flex items-center gap-4">
          <h2 className="text-xl font-bold text-white">镜场地图</h2>
          <span className="text-slate-400 text-sm">
            {stats.total.toLocaleString()} / 14,500 面定日镜
          </span>
        </div>
        
        <div className="flex items-center gap-3">
          {/* 搜索框 */}
          <div className="relative">
            <Search size={16} className="absolute left-3 top-1/2 -translate-y-1/2 text-slate-500" />
            <input
              type="text"
              placeholder="搜索镜子ID..."
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
              onKeyDown={(e) => e.key === 'Enter' && handleSearch()}
              className="pl-9 pr-4 py-2 bg-slate-800 border border-slate-700 rounded-lg text-white text-sm placeholder-slate-500 focus:outline-none focus:ring-2 focus:ring-amber-500/50 w-48"
            />
            {searchQuery && (
              <button 
                onClick={() => { setSearchQuery(''); setSearchResult(null); }}
                className="absolute right-2 top-1/2 -translate-y-1/2 text-slate-500 hover:text-white"
              >
                <X size={14} />
              </button>
            )}
          </div>
          
          {/* 颜色模式 */}
          <div className="flex items-center bg-slate-800 rounded-lg p-1">
            <button
              onClick={() => setColorMode('cleanliness')}
              className={`px-3 py-1.5 text-xs rounded-md transition-all ${
                colorMode === 'cleanliness' ? 'bg-amber-500 text-white' : 'text-slate-400 hover:text-white'
              }`}
            >
              清洁度
            </button>
            <button
              onClick={() => setColorMode('zone')}
              className={`px-3 py-1.5 text-xs rounded-md transition-all ${
                colorMode === 'zone' ? 'bg-amber-500 text-white' : 'text-slate-400 hover:text-white'
              }`}
            >
              分区
            </button>
          </div>
          
          {/* 缩放控制 */}
          <div className="flex items-center gap-1 bg-slate-800 rounded-lg p-1">
            <button
              onClick={() => setZoom(z => Math.max(0.2, z * 0.8))}
              className="p-1.5 text-slate-400 hover:text-white transition-colors"
            >
              <ZoomOut size={18} />
            </button>
            <span className="text-white text-sm w-14 text-center">{(zoom * 100).toFixed(0)}%</span>
            <button
              onClick={() => setZoom(z => Math.min(10, z * 1.25))}
              className="p-1.5 text-slate-400 hover:text-white transition-colors"
            >
              <ZoomIn size={18} />
            </button>
          </div>
          
          <button
            onClick={resetView}
            className="p-2 bg-slate-800 rounded-lg text-slate-400 hover:text-white transition-colors"
            title="重置视图"
          >
            <RotateCcw size={18} />
          </button>
          
          <button
            onClick={() => setShowMinimap(!showMinimap)}
            className={`p-2 rounded-lg transition-colors ${
              showMinimap ? 'bg-amber-500 text-white' : 'bg-slate-800 text-slate-400 hover:text-white'
            }`}
            title="小地图"
          >
            <Navigation size={18} />
          </button>
        </div>
      </div>
      
      <div className="flex flex-1 overflow-hidden">
        {/* 左侧分区面板 */}
        <div className="w-56 bg-slate-900/50 border-r border-slate-800 p-4 flex flex-col gap-4">
          <div>
            <h3 className="text-sm font-semibold text-white mb-3 flex items-center gap-2">
              <Layers size={16} />
              分区选择
            </h3>
            <div className="space-y-2">
              {Object.entries(ZONE_COLORS).map(([zone, colors]) => (
                <div
                  key={zone}
                  className={`flex items-center justify-between p-3 rounded-lg cursor-pointer transition-all ${
                    selectedZones.includes(zone)
                      ? 'bg-slate-800 border border-slate-700'
                      : 'bg-slate-800/50 border border-transparent opacity-50'
                  }`}
                  onClick={() => toggleZone(zone)}
                >
                  <div className="flex items-center gap-3">
                    <div 
                      className="w-4 h-4 rounded"
                      style={{ backgroundColor: colors.bg }}
                    />
                    <span className="text-white text-sm font-medium">{colors.name}</span>
                  </div>
                  <div className="flex items-center gap-2">
                    <span className="text-slate-400 text-xs">
                      {stats.zones[zone]?.count.toLocaleString() || 0}
                    </span>
                    <button
                      onClick={(e) => { e.stopPropagation(); focusZone(zone); }}
                      className="p-1 text-slate-500 hover:text-amber-400 transition-colors"
                      title="定位到此分区"
                    >
                      <Target size={14} />
                    </button>
                  </div>
                </div>
              ))}
            </div>
          </div>
          
          {/* 图例 */}
          <div className="border-t border-slate-800 pt-4">
            <h3 className="text-sm font-semibold text-white mb-3">
              {colorMode === 'cleanliness' ? '清洁度图例' : '分区图例'}
            </h3>
            {colorMode === 'cleanliness' ? (
              <div className="space-y-2 text-xs">
                <div className="flex items-center gap-2">
                  <span className="w-3 h-3 rounded bg-emerald-500"></span>
                  <span className="text-slate-400">优秀 ≥95%</span>
                  <span className="text-slate-500 ml-auto">{stats.excellent}</span>
                </div>
                <div className="flex items-center gap-2">
                  <span className="w-3 h-3 rounded bg-cyan-500"></span>
                  <span className="text-slate-400">良好 85-95%</span>
                  <span className="text-slate-500 ml-auto">{stats.good}</span>
                </div>
                <div className="flex items-center gap-2">
                  <span className="w-3 h-3 rounded bg-amber-500"></span>
                  <span className="text-slate-400">一般 75-85%</span>
                  <span className="text-slate-500 ml-auto">{stats.fair}</span>
                </div>
                <div className="flex items-center gap-2">
                  <span className="w-3 h-3 rounded bg-rose-500"></span>
                  <span className="text-slate-400">较差 &lt;75%</span>
                  <span className="text-slate-500 ml-auto">{stats.poor}</span>
                </div>
              </div>
            ) : (
              <div className="space-y-2 text-xs">
                {Object.entries(ZONE_COLORS).map(([zone, colors]) => (
                  <div key={zone} className="flex items-center gap-2">
                    <span className="w-3 h-3 rounded" style={{ backgroundColor: colors.bg }}></span>
                    <span className="text-slate-400">{colors.name}</span>
                    <span className="text-slate-500 ml-auto">
                      {stats.zones[zone]?.avgClean}%
                    </span>
                  </div>
                ))}
              </div>
            )}
          </div>
          
          {/* 位置信息 */}
          <div className="border-t border-slate-800 pt-4 mt-auto">
            <div className="text-xs text-slate-500 space-y-1">
              <div className="flex items-center gap-2">
                <MapPin size={12} />
                <span>新疆哈密</span>
              </div>
              <div>{CENTER.lat.toFixed(4)}°N, {CENTER.lng.toFixed(4)}°E</div>
            </div>
          </div>
        </div>
        
        {/* 地图区域 */}
        <div className="flex-1 relative" ref={containerRef}>
          <canvas
            ref={canvasRef}
            onWheel={handleWheel}
            onMouseDown={handleMouseDown}
            onMouseMove={handleMouseMove}
            onMouseUp={handleMouseUp}
            onMouseLeave={handleMouseUp}
            onClick={handleClick}
            className="absolute inset-0 cursor-grab active:cursor-grabbing"
          />
          
          {/* 小地图 */}
          {showMinimap && (
            <div className="absolute top-4 right-4 bg-slate-900/90 border border-slate-700 rounded-lg p-2 shadow-xl">
              <canvas id="minimap-canvas" width="150" height="120" className="rounded" />
            </div>
          )}
          
          {/* 选中镜子信息 */}
          {selectedMirror && (
            <div className="absolute bottom-4 left-4 bg-slate-900/95 border border-slate-700 rounded-xl p-4 shadow-xl w-72">
              <div className="flex items-center justify-between mb-3">
                <h4 className="text-white font-semibold">镜子详情</h4>
                <button 
                  onClick={() => setSelectedMirror(null)}
                  className="text-slate-500 hover:text-white"
                >
                  <X size={16} />
                </button>
              </div>
              <div className="space-y-2 text-sm">
                <div className="flex justify-between">
                  <span className="text-slate-400">编号</span>
                  <span className="text-white font-mono">{selectedMirror.id}</span>
                </div>
                <div className="flex justify-between">
                  <span className="text-slate-400">分区</span>
                  <span className="text-white">{ZONE_COLORS[selectedMirror.z].name}</span>
                </div>
                <div className="flex justify-between">
                  <span className="text-slate-400">清洁度</span>
                  <span 
                    className="font-semibold"
                    style={{ color: getCleanlinessColor(selectedMirror.c) }}
                  >
                    {selectedMirror.c}%
                  </span>
                </div>
                <div className="flex justify-between">
                  <span className="text-slate-400">位置</span>
                  <span className="text-white font-mono text-xs">
                    ({selectedMirror.x.toFixed(1)}, {selectedMirror.y.toFixed(1)})m
                  </span>
                </div>
              </div>
              <button className="w-full mt-4 py-2 bg-amber-500 hover:bg-amber-600 text-white text-sm font-medium rounded-lg transition-colors flex items-center justify-center gap-2">
                <Eye size={16} />
                查看拍摄图像
              </button>
            </div>
          )}
          
          {/* 悬停提示 */}
          {hoveredMirror && !selectedMirror && (
            <div 
              className="absolute pointer-events-none bg-slate-800/95 border border-slate-600 rounded-lg px-3 py-2 text-xs shadow-lg"
              style={{
                left: '50%',
                bottom: 20,
                transform: 'translateX(-50%)'
              }}
            >
              <span className="text-white font-mono">{hoveredMirror.id}</span>
              <span className="text-slate-400 mx-2">|</span>
              <span style={{ color: getCleanlinessColor(hoveredMirror.c) }}>
                {hoveredMirror.c}%
              </span>
              <span className="text-slate-400 mx-2">|</span>
              <span style={{ color: ZONE_COLORS[hoveredMirror.z].bg }}>
                {ZONE_COLORS[hoveredMirror.z].name}
              </span>
            </div>
          )}
          
          {/* 搜索结果提示 */}
          {searchResult && (
            <div className="absolute top-4 left-1/2 -translate-x-1/2 bg-amber-500/90 text-white px-4 py-2 rounded-lg text-sm shadow-lg">
              已定位到 {searchResult.id}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default InteractiveMirrorMap;
